    fetchTechnique,
    technique,
    isLoading,
    error,
    options,
  }) {
    const [nameTicker, setNameTicker] = useState("khangtranz");
    const [nameSearch, setNameSearch] = useState("");
    const [checkSearch, setCheckSearch] = useState(true);
    const [nameTickerSuggest, setNameTickerSuggest] = useState([]);

    const [optionsPriceHappenings, setOptionsPriceHappenings] = useState({});
    const [seriesPriceHappenings, setSeriesPriceHappenings] = useState([]);
    const [statusSC, setStatusSC] = useState("");

    useEffect(() => {
      console.log('fetchData');
      fetchTechnique({ nameTicker });
    }, [nameTicker]);

    useLayoutEffect(() => {
      if (!isLoading) {
        console.log('setData')
        setNameTickerSuggest(technique.nameTickerSuggest);
        setOptionsPriceHappenings(technique.optionsPriceHappenings);
      }
    }, [technique]);

    return (
      <h1>Tran Thuc Khang</h1>

    );
  }
